// src/components/Front.js
import React from 'react';
import { Typography, Box } from '@mui/material';
import Header from '../../Layout/Header/Index'; // Import the Header component
import HomePageBanner from '../Front/HomePageBanner'; // Import the HomePageBanner component

const Front = () => {
  return (
    <div>
      {/* Fixed Header */}
      <Header />

      {/* Banner Section */}
      <HomePageBanner />

      {/* Main content below the header */}
      <Box sx={{ padding: 2, marginTop: '60px' }}>
        <Typography variant="h4" gutterBottom>
          Welcome to the Front Page!
        </Typography>
        <Typography variant="body1">
          This is a sample content for the front component. You can customize this component with any content you like.
        </Typography>
      </Box>
    </div>
  );
};

export default Front;
